import React, { useContext } from "react";
import { NameContext } from "../App";
import { AgeContext } from "../App";
const ComC = () => {
  const name = useContext(NameContext);
  const age = useContext(AgeContext);
  return (
    <div>
      <h1>Com C : {name}</h1>
      <br />
      <h1>Age C : {age}</h1>
    </div>
  );
};

export default ComC;
